export type IconType = typeof IconType[keyof typeof IconType];


export function instanceOfIconType(value: any): boolean {
    for (const key in IconType) {
        if (Object.prototype.hasOwnProperty.call(IconType, key)) {
            if (IconType[key as keyof typeof IconType] === value) {
                return true;
            }
        }
    }
    return false;
}

export function IconTypeFromJSON(json: any): IconType {
    return IconTypeFromJSONTyped(json, false);
}

export function IconTypeFromJSONTyped(json: any, ignoreDiscriminator: boolean): IconType {
    return json as IconType;
}

export function IconTypeToJSON(value?: IconType | null): any {
    return value as any;
}

export function IconTypeToJSONTyped(value: any, ignoreDiscriminator: boolean): IconType {
    return value as IconType;
}

